import React from "react"

export default function Home() {
    return (
        <div class="titleDes">
            <h2 class="t">Home</h2>
            <h2 class="r"><b>Seja bem vindo(a)!</b></h2>
            <p class="h2">“A <b>vida</b> é muito curta para <b>viajar</b> somente nas férias”.</p><br />
            <p class="h2">"A <b>felicidade</b> não é um destino, é uma <b>viagem</b>." (Osho)</p>
            <br /><br /><br /><br /><br />
            <br /><br /><br /><br /><br />
        </div>
    );
}
